schema:
{
 "description": "DBProxy is the Schema for the DBProxies API",
 "properties": {
  "spec": {
   "description": "DBProxySpec defines the desired state of DBProxy.\n\n\nThe data structure representing a proxy managed by the RDS Proxy.\n\n\nThis data type is used as a response element in the DescribeDBProxies action.",
   "properties": {
    "auth": {
     "description": "The authorization mechanism that the proxy uses.",
     "items": {
      "description": "Specifies the details of authentication used by a proxy to log in as a specific\ndatabase user.",
      "properties": {
       "authScheme": {
        "type": "string"
       },
       "clientPasswordAuthType": {
        "type": "string"
       },
       "description": {
        "type": "string"
       },
       "iamAuth": {
        "type": "string"
       },
       "secretARN": {
        "type": "string"
       },
       "userName": {
        "type": "string"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "debugLogging": {
     "description": "Whether the proxy includes detailed information about SQL statements in its\nlogs. This information helps you to debug issues involving SQL behavior or\nthe performance and scalability of the proxy connections. The debug information\nincludes the text of SQL statements that you submit through the proxy. Thus,\nonly enable this setting when needed for debugging, and only when you have\nsecurity measures in place to safeguard any sensitive information that appears\nin the logs.",
     "type": "boolean"
    },
    "engineFamily": {
     "description": "The kinds of databases that the proxy can connect to. This value determines\nwhich database network protocol the proxy recognizes when it interprets network\ntraffic to and from the database. For Aurora MySQL, RDS for MariaDB, and\nRDS for MySQL databases, specify MYSQL. For Aurora PostgreSQL and RDS for\nPostgreSQL databases, specify POSTGRESQL. For RDS for Microsoft SQL Server,\nspecify SQLSERVER.",
     "type": "string"
    },
    "idleClientTimeout": {
     "description": "The number of seconds that a connection to the proxy can be inactive before\nthe proxy disconnects it. You can set this value higher or lower than the\nconnection timeout limit for the associated database.",
     "format": "int64",
     "type": "integer"
    },
    "name": {
     "description": "The identifier for the proxy. This name must be unique for all proxies owned\nby your Amazon Web Services account in the specified Amazon Web Services\nRegion. An identifier must begin with a letter and must contain only ASCII\nletters, digits, and hyphens; it can't end with a hyphen or contain two consecutive\nhyphens.",
     "type": "string"
    },
    "requireTLS": {
     "description": "A Boolean parameter that specifies whether Transport Layer Security (TLS)\nencryption is required for connections to the proxy. By enabling this setting,\nyou can enforce encrypted TLS connections to the proxy.",
     "type": "boolean"
    },
    "roleARN": {
     "description": "The Amazon Resource Name (ARN) of the IAM role that the proxy uses to access\nsecrets in Amazon Web Services Secrets Manager.",
     "type": "string"
    },
    "tags": {
     "description": "An optional set of key-value pairs to associate arbitrary data of your choosing\nwith the proxy.",
     "items": {
      "description": "Metadata assigned to an Amazon RDS resource consisting of a key-value pair.\n\n\nFor more information, see Tagging Amazon RDS Resources (https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/USER_Tagging.html)\nin the Amazon RDS User Guide.",
      "properties": {
       "key": {
        "type": "string"
       },
       "value": {
        "type": "string"
       }
      },
      "type": "object"
     },
     "type": "array"
    },
    "vpcSecurityGroupIDs": {
     "description": "One or more VPC security group IDs to associate with the new proxy.",
     "items": {
      "type": "string"
     },
     "type": "array"
    },
    "vpcSubnetIDs": {
     "description": "One or more VPC subnet IDs to associate with the new proxy.",
     "items": {
      "type": "string"
     },
     "type": "array"
    }
   },
   "required": [
    "auth",
    "engineFamily",
    "name",
    "roleARN",
    "vpcSubnetIDs"
   ],
   "type": "object"
  }
 },
 "title": "DB Proxy",
 "type": "object"
}
